	public void paint(Graphics2D g) {
		imagePainter(g, bridgeScene.getGalahad());
		linePainter(g, bridgeScene.getGalahad().getTorso());
		limbsPainter(g, bridgeScene.getGalahad().getArms(), bridgeScene.getGalahad().getLegs());
		stringPainter(g, bridgeScene.getGalahad().getStringShape());


	}

